  @override
  String get privacyPolicyTermsContent => 'Définition de l\'application et sa nature opérationnelle\n\nL\'application ne collecte aucune information sur les utilisateurs car l\'application est uniquement destinée à afficher des informations et ne contient aucune fonctionnalité pour se connecter et créer un compte et saisir tout type de données\n\nSources que l\'application utilise sur l\'appareil de l\'utilisateur\nL\'application n\'utilise aucune source ou ressource de l\'ordinateur, elle a seulement besoin d\'une connexion Internet à partir de données mobiles ou WIFI\n\nPartage de données personnelles si elles existent\nIl n\'y a aucune information personnelle sur l\'utilisateur\n\nSe désabonner\nIl n\'y a aucune fonctionnalité d\'abonnement dans l\'application\n\nMise à jour de la politique d\'utilisation et comment l\'utilisateur est notifié\nEn cas de mise à jour de la politique de confidentialité, elle sera affichée à l\'utilisateur avec une référence explicite aux modifications apportées, et la politique de confidentialité sera effective de manière à permettre à l\'utilisateur de l\'accepter ou de la rejeter\n\nToute autre information nécessaire que le propriétaire de l\'application juge appropriée\nEn téléchargeant ou en utilisant l\'application, ces termes s\'appliqueront automatiquement à vous - par conséquent, vous devez vous assurer de les lire attentivement avant d\'utiliser l\'application. Vous n\'êtes pas autorisé à copier ou modifier l\'application ou toute partie de celle-ci ou nos marques de commerce de quelque manière que ce soit. Vous n\'êtes pas autorisé à essayer d\'extraire le code source de l\'application, et vous ne devez pas essayer de traduire l\'application dans d\'autres langues ou créer des versions dérivées. L\'application elle-même et toutes les marques de commerce, droits d\'auteur, droits de base de données et autres droits de propriété intellectuelle qui s\'y rapportent restent la propriété du Ministère syrien du Tourisme.\n\nVous êtes responsable de maintenir votre téléphone et l\'accès à l\'application sécurisés. Par conséquent, nous vous recommandons de ne pas faire de jailbreak ou de root de votre téléphone, ce qui est le processus de suppression des restrictions logicielles et des limitations imposées par le système d\'exploitation officiel de votre appareil. Cela peut rendre votre téléphone vulnérable aux logiciels malveillants/virus/programmes malveillants, compromettre les fonctionnalités de sécurité de votre téléphone et pourrait signifier que l\'application 963 ne fonctionnera pas correctement ou pas du tout.\n\nVous devez être conscient qu\'il y a certaines choses pour lesquelles ArtFly ne prendra pas la responsabilité. Certaines fonctions de l\'application nécessiteront que l\'application ait une connexion Internet active. La connexion peut être via Wi-Fi ou fournie par votre fournisseur de réseau mobile, mais ArtFly ne peut pas prendre la responsabilité de l\'application qui ne fonctionne pas à pleine fonctionnalité si vous n\'avez pas accès au Wi-Fi, et vous n\'avez aucune autre connexion Internet.\n\nEn ce qui concerne la responsabilité d\'ArtFly pour votre utilisation de l\'application, lors de l\'utilisation de l\'application, il est important de garder à l\'esprit que bien que nous nous efforcions de nous assurer qu\'elle est mise à jour et correcte à tout moment, nous nous appuyons sur des tiers pour nous fournir des informations afin que nous puissions les mettre à votre disposition. ArtFly n\'accepte aucune responsabilité pour toute perte, directe ou indirecte, que vous subissez à la suite d\'un recours total à cette fonctionnalité de l\'application.\n\nModifications de ces conditions générales\nNous pouvons mettre à jour nos conditions générales de temps à autre. Ainsi, il vous est conseillé de réviser cette page périodiquement pour tout changement. Nous vous informerons de tout changement en publiant les nouvelles conditions générales sur cette page.\n\nCes termes et conditions sont effectifs à partir du 2024-09-01';

