  @override
  String get aboutUsContent => 'Application 963SY\nL\'une des œuvres les plus importantes de la Fondation Artfly... est l\'organisation qui a joué un rôle important dans le voyage de l\'innovation, de la photographie, de la documentation et de l\'excellence dans l\'utilisation des drones pour la photographie aérienne.\nL\'application 963SY est un package d\'informations complet qui rend le tourisme accessible à tous, indépendamment de leurs capacités physiques ou linguistiques.\nElle fournit des connaissances sur la Syrie, son histoire, son patrimoine et ses lieux touristiques, et contribue à accroître la prise de conscience de son existence et de son importance.\nElle fournit une base de données pour présenter les belles attractions et lieux touristiques locaux, ainsi que tous les événements et activités qui se déroulent en Syrie... Elle les affiche avec des vidéos et des photos spéciales qui reflètent la beauté de la Syrie et mettent en évidence les expériences passionnantes qui peuvent être appréciées là-bas.\nL\'utilisateur de l\'application 963SY peut parcourir la carte touristique disponible de différents lieux et sites et y accéder facilement et rapidement, en plus des informations et textes liés à chaque lieu séparément.\nL\'application 963SY est un guide de la prise de conscience, de l\'exploration et du patrimoine spirituel que ce beau pays embrasse, et permet au monde de découvrir ses composants et de les visiter d\'un clic. Elle combine culture et technologie, et donne aux touristes une véritable expérience de voyage virtuel. Dans un monde qui manque de temps et d\'opportunités. Elle fournit également une expérience surround complète des sites touristiques avec un angle de vue à 360 degrés pour explorer chaque coin et toute la beauté des paysages époustouflants de la Syrie.\nL\'application 963SY fournit une expérience intégrée et complète pour toutes les différentes catégories d\'utilisateurs, y compris ceux qui font face à des défis dans la communication et la compréhension des informations en raison de leur handicap auditif.\nL\'application 963SY reflète la vision d\'artfly de servir la communauté et d\'améliorer la communication culturelle et touristique grâce à la technologie avancée et à l\'innovation.';

